@KyivIndependent I am troubled about the living condition of innocent Ukrainian women and children. Putin has declared war on Ukraine. Why are you pointing out targets for him to attack?
Please @ZelenskyyUa the world is watching. Take the war to Putin's doorsteps.

Winter Is Coming!

@NewVoiceUkraine Negotiations -

Russia: blah-blah-blah-blah
Ukraine: GET THE FUCK OUT!!

@CanadianCentury It's common knowledge that I support Ukraine's independence from Russia - this doesn't mean I feel kids just out of school deserve to burn alive in a BMP.

The top brass? Fuck em, turn them to a fine, red mist. 

They did this.
